import Map from "../Map";

class App extends Component {
  constructor(props) {
    super(props);

    this.state = {
      cities: []
    };
  }

  componentDidMount() {
    const USGS_URL =
      "https://api.teleport.org/api/";
    axios
      .get(USGS_URL)
      .then(response => {
        const cities = response.data;
        this.setState({
